CREATE TABLE sys.sysindexes
(
    id int NOT NULL,
    status int,
    first binary(6),
    indid smallint,
    root binary(6),
    minlen smallint,
    keycnt smallint,
    groupid smallint,
    dpages int,
    reserved int,
    used int,
    rowcnt bigint,
    rowmodctr int,
    reserved3 tinyint,
    reserved4 tinyint,
    xmaxlen smallint,
    maxirow smallint,
    OrigFillFactor tinyint,
    StatVersion tinyint,
    reserved2 int,
    FirstIAM binary(6),
    impid smallint,
    lockflags smallint,
    pgmodctr int,
    keys varbinary(1088),
    name sysname,
    statblob image,
    maxlen int,
    rows int
);
